from datetime import *

def seconds_ago(s,n):
    return str(datetime.strptime(s, '%Y-%m-%d %H:%M:%S') - timedelta(seconds=n))

from datetime import datetime,timedelta

def seconds_ago(s,n):
    t = datetime.strptime(s,'%Y-%m-%d %H:%M:%S')-timedelta(seconds=n)
    return str(t.year).zfill(4)+t.strftime('-%m-%d %H:%M:%S')

from dateutil import parser
import datetime

def seconds_ago(s,n):
    timej = parser.parse(s) - datetime.timedelta(seconds=n)
    return  str(timej)

